import "./App.css";

function App() {
  const title = "Welcome to the new blog!";
  const likes = 50;
  let john = [1, 2, 3, 4, 5, 65, 6];

  return (
    <div className="App">
      <div className="content">
        <h1> {title} </h1>
        <p>Liked {likes} times.</p>
        <p> {john.splice(4)} </p>
      </div>
    </div>
  );
}

export default App;
